	add("acceleration", "{\"term\":\"acceleration\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"French\", \"Latin\"], \"text\":\"First attested in 1531. From French \u0027acceleration\u0027 or more likely directly from Latin {{m|la|accelerātiō||a hastening, acceleration}}\u0026lt;ref\u0026gt;{{R:CDOE|page\u003d6}}\u0026lt;/ref\u0026gt;. Equivalent to {{suffix|accelerate|ion|lang\u003den}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The act of accelerating, or the state of being accelerated; increase of motion or action; as opposed to retardation or deceleration\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"a falling body moves toward the earth with an \u0027\u0027acceleration\u0027\u0027 of velocity\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The amount by which a speed or velocity increases (and so a scalar quantity or a vector quantity\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"The boosters produce an acceleration of 20 metres per second per second\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"w:Isaac Isaac Taylo\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"A period of social improvement, or of intellectual advancement, contains within itself a principle of \u0027\u0027acceleration\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"The change of velocity with respect to time (can include deceleration or changing direction\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"The advancement of students at a rate that places them ahead of where they would be in the regular school curriculum\", \"priority\":8}]}, \"synonyms\":{}}");

