	add("accelerator", "{\"term\":\"accelerator\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"* First attested in 1611.* {{sense|motor vehicle}} First attested in 1900.* {{suffix|accelerate|or|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"One who, or that which, accelerates\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A device for causing acceleration\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A substance which speeds up chemical reactions\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"An accelerator pedal\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"A chemical that reduces development time\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"A device that accelerates charged subatomic particles\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"A muscle or nerve that speed the performance of an action\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"accelerator ke\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"2002\u0027\u0027, Davis Howard Chapman, \u0027Sams Teach Yourself Visual C++ .NET in 21 Days\u0027 (page 187\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"If they had allowed single-character \u0027\u0027accelerators\u0027\u0027, Windows wouldn\u0027t be able to determine whether the character was input or a shortcut\", \"priority\":10}]}, \"synonyms\":{}}");

