	add("accentor", "{\"term\":\"accentor\", \"etymology\":{\"influencers\":[{},{}], \"languages\":[\"English\", \"Latin\"], \"text\":\"* From Latin \u0027accentor\u0027 (one who sings with another) from \u0027ad\u0027 + \u0027cantor\u0027 (singer) from {{m|la|canō||sing}}.* {{suffix|accent|or|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Prunella\u0027, a genus of European birds (so named from their sweet notes), including the hedge warbler. In America sometimes applied to the water thrushes\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"One who sings the leading part; the director or leader\", \"priority\":2}]}, \"synonyms\":{}}");

