	add("acceptability", "{\"term\":\"acceptability\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|acceptable|ity|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The quality of being acceptable; acceptableness\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Acceptability\u0027 of repentance. - Jeremy Taylor, about 164\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Operation plan review criterion. The determination as to whether the contemplated course of action is worth the cost in manpower, materiel, and time involved; is consistent with the law of war; and is militarily and politically supportable. (JP 1-02 Department of Defense Dictionary of Military and Associated Terms\", \"priority\":3}]}, \"synonyms\":{}}");

	add("acceptance", "{\"term\":\"acceptance\", \"etymology\":{\"influencers\":[{}], \"languages\":[\"English\", \"middle french (ca. 1400-1600)\", \"old french (842-ca. 1400)\"], \"text\":\"First attested in 1574. From Middle french (ca. 1400-1600) \u0027acceptance\u0027 from Old french (842-ca. 1400) \u0027accepter\u0027 (accept) Equivalent to {{suffix|accept|ance|nocat\u003d1|lang\u003den}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The act of accepting; a receiving of something offered, with approbation, satisfaction, or acquiescence; especially, favorable reception; approva\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"the \u0027\u0027acceptance\u0027\u0027 of a gift, office, doctrine, etc\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Isaiah 60:7\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"They shall come up with \u0027\u0027acceptance\u0027\u0027 on mine altar\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Belief in something; agreement; assent\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"State of being accepted\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"Shakespeare: \u0027Rape of Lucrece\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"Makes it assured of \u0027\u0027acceptance\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"An assent and engagement by the person on whom a bill of exchange is drawn, to pay it when due according to the terms of the acceptance\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"The bill of exchange itself when accepted\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"An agreeing to terms or proposals by which a bargain is concluded and the parties are bound; the reception or taking of a thing bought as that for which it was bought, or as that agreed to be delivered, or the taking possession as owner\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"An agreeing to the action of another, by some act which binds the person in law\", \"priority\":12},{\"upperType\":\"NOUN\", \"text\":\"The act of an authorized representative of the Government by which the Government assents to ownership by it of existing and identified supplies, or approves specific services rendered, as partial or complete performance of a contract\", \"priority\":13},{\"upperType\":\"NOUN\", \"text\":\"The usual or accepted meaning of a word or expression\", \"priority\":14},{\"upperType\":\"NOUN\", \"text\":\"A list of horses accepted as starters in a race\", \"priority\":15}]}, \"synonyms\":{}}");

