	add("acceptation", "{\"term\":\"acceptation\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|accept|ation|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Acceptance; reception; favorable reception or regard; the state of being acceptable\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1676\u0027\u0027, w:Richard Richard Hooker, w:Izaak Izaak Walton, \u0027The Second Book of Eccleſiaſtical Polity\u0027, in \u0027The Works of that Learned and Judicious Divine, Mr. Richard Hooker, in Eight Books of Eccleſiaſtical Polity\u0027, [http://books.google.com/books?id\u003dfiRWAAAAYAAJ\u0026amp;pg\u003dPA122\u0026amp;dq\u003d%22are+notwithstanding+of+so+great+dignity+and+acceptation+with+God%22+-intitle:%22%22\u0026amp;hl\u003den\u0026amp;ei\u003dKOynTtrBI66ViQf4z7iqDg\u0026amp;sa\u003dX\u0026amp;oi\u003dbook_result\u0026amp;ct\u003dresult\u0026amp;resnum\u003d4\u0026amp;ved\u003d0CD4Q6AEwA\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22are%20notwithstanding%20of%20so%20great%20dignity%20and%20acceptation%20with%20God%22%20-intitle%3A%22%22\u0026amp;f\u003dfalse page 122\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Finally, ſome things although not ſo required of neceſſity, that to leave them undone excludeth from Salvation, are notwithſtanding of so great dignity and \u0027\u0027acceptation\u0027\u0027 with God, that moſt ample reward in Heaven is laid up for them\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"1769\u0027\u0027, Oxford Standard text, \u0027s:Bible (King James)/1 King James Bible: 1 Timothy\u0027, i, 15\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"This is a faithful saying, and worthy of all \u0027\u0027acceptation\u0027\u0027, that Christ Jesus came into the world to save sinners; of whom I am chief\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"The meaning in which a word or expression is understood, or generally received\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"The term is to be used according to its usual \u0027\u0027acceptation\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"1731\u0027\u0027 January 30, w:John John Gay, \u0027Fable: The Dog and the Fox: To a Lawyer\u0027, in Caleb D\u0027Anvers (w:Nicholas Nicholas Amhurst, editor), \u0027The Craftsman\u0027, Volume VII, [http://books.google.com/books?id\u003dODAJAAAAQAAJ\u0026amp;pg\u003dPA233\u0026amp;dq\u003d%22My+words,+in+common+%27%27%27acceptation%27%27%27,+Could+never+give+this+provocation%22+-intitle:%22%22\u0026amp;hl\u003den\u0026amp;ei\u003dufSnTo7WFqm6iQf7x-CnDg\u0026amp;sa\u003dX\u0026amp;oi\u003dbook_result\u0026amp;ct\u003dresult\u0026amp;resnum\u003d8\u0026amp;ved\u003d0CE4Q6AEwB\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22My%20words%2C%20in%20common%20%27%27%27acceptation%27%27%27%2C%20Could%20never%20give%20this%20provocation%22%20-intitle%3A%22%22\u0026amp;f\u003dfalse page 233\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"My words, in common \u0027\u0027Acceptation\u0027\u0027, / Could never give this Provocation\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"Ready belief\", \"priority\":12}]}, \"synonyms\":{}}");

	add("accepter", "{\"term\":\"accepter\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|accept|er|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A person who accepts; a taker\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A respecter; a viewer with partiality\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Chillingworth\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"God is no \u0027accepter\u0027 of persons\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"An acceptor; one who accepts an order or a bill of exchange\", \"priority\":5}]}, \"synonyms\":{}}");

	add("acceptilation", "{\"term\":\"acceptilation\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Latin\"], \"text\":\"From Latin \u0027acceptilatio\u0027 entry of a debt collected, acquittance, from past participle of \u0027accipere\u0027 (compare \u0027accept\u0027) + \u0027latio\u0027 a carrying, from \u0027latus\u0027, past participle of \u0027ferre\u0027 to carry: (also in French)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Gratuitous discharge; a release from debt or obligation without payment; free remission\", \"priority\":1}]}, \"synonyms\":{}}");

	add("acceptor", "{\"term\":\"acceptor\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|accept|or|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"One who accepts\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"One who accepts a draft or a bill of exchange; a drawee after he has accepted\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"An atom or molecule which can accept an electron to form a chemical bond\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A transfer RNA molecule that can accept a specific amino aci\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"A chemical acceptor atom forming a positive hole in a semiconductor\", \"priority\":5}]}, \"synonyms\":{}}");

