	add("accessibility", "{\"term\":\"accessibility\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Latin\"], \"text\":\"* {{suffix|accessible|ity|lang\u003den}}, after \u0027accessibilitas\u0027 from Latin \u0027accessibilis\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The quality of being accessible, or of admitting approach; receptiveness\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Features that increase software usability for users with certain impairments\", \"priority\":2}]}, \"synonyms\":{}}");

	add("accession", "{\"term\":\"accession\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Latin\"], \"text\":\"* First attested in 1646.* From Latin \u0027accessio\u0027 from {{m|la|accēdō}} (English \u0027accede\u0027 . Cognate to French \u0027accession\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A coming to; the act of acceding and becoming joined; as, a king\u0027s \u0027\u0027accession\u0027\u0027 to a confederacy\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Increase by something added; that which is added; augmentation from without\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"w:Edward Edward Gibbo\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"The only \u0027\u0027accession\u0027\u0027 that the Roman empire received was the province of Britain\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"A mode of acquiring property, by which the owner of a corporeal substance which receives an addition by growth, or by labor, has a right to the part or thing added, or the improvement (provided the thing is not changed into a different species\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"The act by which one power becomes party to engagements already in force between other powers\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"The act of coming to or reaching a throne, an office, or dignity\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"The invasion, approach, or commencement of a disease; a fit or paroxysm\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"Agreement\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"Access; admittance\", \"priority\":10}]}, \"synonyms\":{}}");

	add("accessoriness", "{\"term\":\"accessoriness\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"Derivative of accessory\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The state of being accessory, or connected subordinately\", \"priority\":1}]}, \"synonyms\":{}}");

	add("acciaccatura", "{\"term\":\"acciaccatura\", \"etymology\":{\"influencers\":[{}], \"languages\":[], \"text\":\"{{borrowing|it|acciaccatura|lang\u003den}}, from the verb \u0027acciaccare\u0027 (to crush)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A short grace note (theoretically taking no time at all), occurring on the beat occupied by the main note to which it is prefixed, one scale-step higher or lower than that main note. (Sometimes equivalent, therefore, to a short \u0027appoggiatura\u0027, but in Baroque music interpreted differently and more strictly.) Written as a note lighter in appearance, typically a quaver (eighth note), with an oblique stroke through the stem\", \"priority\":1}]}, \"synonyms\":{}}");

	add("accidence", "{\"term\":\"accidence\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Latin\"], \"text\":\"* First attested in the late 14th century.* {{sense|grammar}} First attested in the mid 15th century. * From Latin \u0027accidentia\u0027 (lang\u003dla) from \u0027accidens\u0027 present participle of \u0027accidere\u0027 (lang\u003dla)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The \u0027\u0027accidents\u0027\u0027, of inflections of words; the rudiments of grammar\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A book containing the first principles of grammar, and so of the rudiments of any subject or art\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The rudiments of any subject\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"James Russell Lowel\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Our best schools send every year to college boys who know their \u0027\u0027accidence\u0027\u0027 reasonably, and in some cases admirably well\", \"priority\":5}]}, \"synonyms\":{}}");

	add("accident", "{\"term\":\"accident\", \"etymology\":{\"influencers\":[{}], \"languages\":[\"English\", \"middle english (1100-1500)\", \"old french (842-ca. 1400)\", \"Latin\"], \"text\":\"First attested in the late 14th century. First attested in reference to an unintended pregnancy in 1932. From Middle english (1100-1500) from Old french (842-ca. 1400) \u0027accident\u0027 from Latin {{m|la|accidēns}}, present active participle of {{m|la|accidō||happen}}; from \u0027ad\u0027 (to) + {{m|la|cadō||fall}}. See \u0027cadence\u0027 \u0027case\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An unexpected event with negative consequences occurring without the intention of the one suffering the consequences\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"c.1603\u0027\u0027, \u0027s:The Tragedy of Othello, The Moor of The Tragedy of Othello, The Moor of Venice\u0027, I-iii\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Wherein I spake of most disastrous chances, / Of moving \u0027\u0027accidents\u0027\u0027 by flood and fiel\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Especially, a collision or similar unintended event that causes damage or death\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"title\u003d[http://www.americanscientist.org/issues/feature/2013/4/solvents-ethanol-car-crashes-amp-tolerance Solvents, Ethanol, Car Crashes \u0026amp; passage\u003dSurprisingly, this analysis revealed that acute exposure to solvent vapors at concentrations below those associated with long-term effects appears to increase the risk of a fatal automobile \u0027\u0027accident\u0027\u0027. Furthermore, this increase in risk is comparable to the risk of death from leukemia after long-term exposure to benzene, another solvent, which has the well-known property of causing this type of cancer\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"Any chance event\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"Chance\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"c.1861-1863\u0027\u0027, in 1888, \u0027Letters and memorials\u0027, Volume 1\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"Thou cam\u0027st not to thy place by \u0027\u0027accident\u0027\u0027, / It is the very place God meant for thee\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"Any property, fact, or relation that is the result of chance or is nonessential\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"1883\u0027\u0027, \u0027Social life in Greece from Homer to Menander‎\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"This \u0027\u0027accident\u0027\u0027, as I call it, of Athens being situated some miles from the sea, which is rather the consequence of its being a very ancient site\", \"priority\":12},{\"upperType\":\"NOUN\", \"text\":\"An instance of incontinence\", \"priority\":13},{\"upperType\":\"NOUN\", \"text\":\"2009\u0027\u0027, Marcia Stedron, \u0027My Roller Coaster Life as an Army Wife\u0027, Xlibris Corporation, ISBN 1462817890, [http://books.google.de/books?id\u003dby6CBEvNtWIC\u0026amp;lpg\u003dPA56\u0026amp;pg\u003dPA56\u0026amp;f\u003dfals\", \"priority\":14},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u0026amp;f\u003dfalse page 56\", \"priority\":15},{\"upperType\":\"NOUN\", \"text\":\"We weren’t there long when Karin asked about our dog. When we told her Chris was in the car, she insisted we bring him up to the apartment. I rejected her offer and said he might have an \u0027\u0027accident\u0027\u0027 on the carpet and I didn’t want to worry about it\", \"priority\":16},{\"upperType\":\"NOUN\", \"text\":\"An unintended pregnancy\", \"priority\":17},{\"upperType\":\"NOUN\", \"text\":\"A quality or attribute in distinction from the substance, as \u0027sweetness\u0027, \u0027softness\", \"priority\":18},{\"upperType\":\"NOUN\", \"text\":\"1902\u0027\u0027, William James, \u0027The Varieties of Religious Experience\u0027, Folio Society 2008, page 171\", \"priority\":19},{\"upperType\":\"NOUN\", \"text\":\"If they went through their growth-crisis in other faiths and other countries, although the essence of the change would be the same, its \u0027\u0027accidents\u0027\u0027 would be different\", \"priority\":20},{\"upperType\":\"NOUN\", \"text\":\"A property attached to a word, but not essential to it, as gender, number, case\", \"priority\":21},{\"upperType\":\"NOUN\", \"text\":\"An irregular surface feature with no apparent cause\", \"priority\":22},{\"upperType\":\"NOUN\", \"text\":\"A point or mark which may be retained or omitted in a coat of arms\", \"priority\":23},{\"upperType\":\"NOUN\", \"text\":\"casus; such unforeseen, extraordinary, extraneous interference as is out of the range of ordinary calculation\", \"priority\":24},{\"upperType\":\"NOUN\", \"text\":\"An unplanned event that results in injury (including death) or occupational illness to person(s) and/or damage to property, exclusive of injury and/or damage caused by action of an enemy or hostile force\", \"priority\":25},{\"upperType\":\"NOUN\", \"text\":\"Appearance, manifestation\", \"priority\":26},{\"upperType\":\"NOUN\", \"text\":\"14thC\u0027\u0027, \u0027s:The Canterbury Tales/The Pardoner\u0027s Prologue and The Pardoner\u0027s Prologue and Tale\u0027 in\", \"priority\":27},{\"upperType\":\"NOUN\", \"text\":\"These cookes how they stamp, and strain, and grind, / And turne substance into \u0027\u0027accident\u0027\u0027, / To fulfill all thy likerous talent\", \"priority\":28},{\"upperType\":\"NOUN\", \"text\":\"1677\u0027\u0027, \u0027Heraclitus Christianus: or, the Man of Sorrow\u0027, chapter 3, page 14\", \"priority\":29},{\"upperType\":\"NOUN\", \"text\":\"But as to Man, all the Fruits of the Earth, all sorts of Herbs, Plants and Roots, the Fishes of the Sea, and the Birds of the Air do not suffice him, but he must disguise, vary, and sophisticate, change the substance into \u0027\u0027accident\u0027\u0027, that by such irritations as these, Nature might be provoked, and as it were necessitated\", \"priority\":30},{\"upperType\":\"NOUN\", \"text\":\"1989\u0027\u0027, Iysa A. Bello, \u0027The medieval Islamic controversy between philosophy and orthodoxy\u0027, page 55\", \"priority\":31},{\"upperType\":\"NOUN\", \"text\":\"Nonetheless, those who have no evidence of the impossibility of the transformation of \u0027\u0027accident\u0027\u0027 into substance believe that it is death itself which will be actually transformed into a ram on the Day of Resurrection and then be slaughtered\", \"priority\":32},{\"upperType\":\"NOUN\", \"text\":\"2005\u0027\u0027, Muhammad Ali Khalidi, \u0027Medieval Islamic philosophical writings\u0027, page 175\", \"priority\":33},{\"upperType\":\"NOUN\", \"text\":\"It would also follow that God ought to be able to transmute genera, converting substance into \u0027\u0027accident\u0027\u0027, knowledge into ability, black into white, and sound into smell, just as he can turn the inanimate into animat\", \"priority\":34},{\"upperType\":\"NOUN\", \"text\":\"2010\u0027\u0027, T. M. Rudavsky, \u0027Maimonides\u0027, page 142\", \"priority\":35},{\"upperType\":\"NOUN\", \"text\":\"nor can God effect the transmutation of substances (from \u0027\u0027accident\u0027\u0027 into substance, or substance into \u0027\u0027accident\u0027\u0027, or substance without \u0027\u0027accident\", \"priority\":36}]}, \"synonyms\":{}}");

	add("accidentality", "{\"term\":\"accidentality\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|accident|ality|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Quality of being accidental; accidentalness\", \"priority\":1}]}, \"synonyms\":{}}");

	add("accidie", "{\"term\":\"accidie\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"old french (842-ca. 1400)\", \"ancient greek (to 1453)\", \"anglo-norman\"], \"text\":\"From Anglo-norman \u0027accidie\u0027 Old french (842-ca. 1400) \u0027accide\u0027 \u0027accidie\u0027 from {{m|la|accīdia}}, alteration of {{m|la|acēdia||sloth, torpor}}, from Ancient greek (to 1453) \u0027ἀκήδεια\u0027 (indifference) from \u0027ἀ-\u0027 (not) + \u0027κῆδος\u0027 (care)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Sloth, slothfulness, especially as inducing general listlessness and apathy\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"c. 1390\u0027\u0027, ‘The Parson\u0027s Tale’, \u0027Canterbury Tales\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Aftere þe synnes of Envie I wil speke of þe synne of \u0027\u0027Accidie\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1978\u0027\u0027, \u0027Livia\u0027, Faber \u0026amp; Faber 1992 , p. 363\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Underneath the surface excitements the demon of \u0027\u0027accidie\u0027\u0027 had her by the hair\", \"priority\":5}]}, \"synonyms\":{}}");

	add("accipiter", "{\"term\":\"accipiter\", \"etymology\":{\"influencers\":[{}], \"languages\":[\"English\", \"Latin\"], \"text\":\"From Latin \u0027accipiter\u0027 (hawk)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Any hawk of the genus \u0027Accipiter\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A bandage applied over the nose, resembling the claw of a hawk\", \"priority\":2}]}, \"synonyms\":{}}");

