	add("acclimatization", "{\"term\":\"acclimatization\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|acclimatize|ation|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The act of acclimatizing; the process of inuring to a new climate, or the state of being so inured\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The climatic adaptation of an organism that has been moved to a new environment\", \"priority\":2}]}, \"synonyms\":{}}");

