	add("accompaniment", "{\"term\":\"accompaniment\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"* First attested in 1744.* {{suffix|accompany|ment|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A part, usually performed by instruments, that gives support or adds to the background in music, or adds for ornamentation; also, the harmony of a figured bass\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"That which accompanies; something that attends as a circumstance, or which is added to give greater completeness to the principal thing, or by way of ornament, or for the sake of symmetry\", \"priority\":2}]}, \"synonyms\":{}}");

