	add("accouchement", "{\"term\":\"accouchement\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"old french (842-ca. 1400)\", \"Latin\"], \"text\":\"* First attested in 1803.{{borrowing|fr|lang\u003den}} \u0027lang\u003dfr|accoucher\u0027 () from Old french (842-ca. 1400) \u0027acouchier\u0027 (lang\u003dfro) from Latin \u0027ad\u0027 + \u0027collocare\u0027 (lang\u003dla) See collate\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Delivery in childbed; parturitio\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Custom required that the royal family and the whole Court should be present at the accouchement of the Princesses\", \"priority\":2}]}, \"synonyms\":{}}");

	add("accoucheur", "{\"term\":\"accoucheur\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"old french (842-ca. 1400)\", \"Latin\"], \"text\":\"* First attested in 1759.* {{borrowing|fr|accoucheur|lang\u003den}}, from {{m|fr|accoucher||to go to childbed, be delivered}}, from Old french (842-ca. 1400) {{m|fro|culcher||to lie}}, from Latin {{m|la|collocō||I place, put, set in order, assign}}, from {{m|la|cum|com|with}} + {{m|la|locō||I put, place, set}}. See {{m|en|accouchement}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A man who assists women in childbirth; a male midwife; an obstetrician\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1992\u0027\u0027, Hilary Mantel, \u0027A Place of Greater Safety\u0027, Harper Perennial 2007, p. 163\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Family story: on the day of his birth the \u0027\u0027accoucheur\u0027\u0027 approached his father, the baby wrapped in a cloth\", \"priority\":3}]}, \"synonyms\":{}}");

	add("accountability", "{\"term\":\"accountability\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From {{suffix|accountable|ity|lang\u003den}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The state of being accountable; liability to be called on to render an account; accountableness; responsible for; answerable for\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The obligation imposed by law or lawful order or regulation on an officer or other person for keeping accurate record of property, documents, or funds. The person having this obligation may or may not have actual possession of the property, documents, or funds. Accountability is concerned primarily with records, while responsibility is concerned primarily with custody, care, and safekeeping. (JP 1-02 Department of Defense Dictionary of Military and Associated Terms\", \"priority\":2}]}, \"synonyms\":{}}");

	add("accountableness", "{\"term\":\"accountableness\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|accountable|ness|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The quality or state of being accountable; accountability\", \"priority\":1}]}, \"synonyms\":{}}");

	add("accountancy", "{\"term\":\"accountancy\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|account|ancy|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The function of compiling and providing financial information primarily by reports referred to as financial statements. Accounting includes bookkeeping, systems design, analysis and interpretation of accounting information\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A company or organisation that performs such a function\", \"priority\":2}]}, \"synonyms\":{}}");

