	add("accouterment", "{\"term\":\"accouterment\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"middle french (ca. 1400-1600)\", \"old french (842-ca. 1400)\"], \"text\":\"* First attested in the 1540s.* From Middle french (ca. 1400-1600) \u0027accoustrement\u0027 from \u0027accoustrer\u0027 from Old french (842-ca. 1400) \u0027acostrer\u0027 (arrange, sew up)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The act of accoutering\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"An article of clothing or equipment, in particular when used as an accessory\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"apparatus needed for a task or journey\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Equipment other than weapons and uniform\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"trappings\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"An identifying yet superficial characteristic\", \"priority\":6}]}, \"synonyms\":{}}");

