	add("accreditation", "{\"term\":\"accreditation\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"* First attested in 1806.* {{suffix|accredit|ation|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The giving of credentials\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The act of accrediting\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"letters of \u0027\u0027accreditation\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"The granting of approval to an institution of higher learning by an official review board after the school has met certain requirements\", \"priority\":4}]}, \"synonyms\":{}}");

