	add("accretion", "{\"term\":\"accretion\", \"etymology\":{\"influencers\":[{}], \"languages\":[\"English\", \"Latin\"], \"text\":\"* First attested in the 1610\u0027s.* From Latin \u0027accretio\u0027 from \u0027ad\u0027 (to) + {{m|la|crēscō||grow}}.* Compare crescent, increase, accrue\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The act of increasing by natural growth; especially the increase of organic bodies by the internal accession of parts; organic growth\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1900\u0027\u0027, w:Charles W. Charles W. Chesnutt, \u0027w:The House Behind the The House Behind the Cedars\u0027, Chapter I\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"There might have been a slight \u0027\u0027accretion\u0027\u0027 of the moss and lichen on the shingled roof\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"The act of increasing, or the matter added, by an accession of parts externally; an extraneous addition; as, an \u0027accretion\u0027 of earth\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"A mineral ... augments not by growth, but by \u0027\u0027accretion\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"To strip off all the subordinate parts of his as a later \u0027\u0027accretion\u0027\u0027 - w:George Cornewall George Cornewall Lewi\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"Something added externally to promote growth the external growth of an item\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"concretion; coherence of separate particles; as, the \u0027accretion\u0027 of particles so as to form a solid mass\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"A growing together of parts naturally separate, as of the fingers or toes\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"The gradual increase of land by deposition of water-borne sediment\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"The adhering of property to something else, by which the owner of one thing becomes possessed of a right to another; generally, gain of land by the washing up of sand or sail from the sea or a river, or by a gradual recession of the water from the usual watermark\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"Gain to an heir or legatee; failure of a coheir to the same succession, or a co-legatee of the same thing, to take his share percentage\", \"priority\":12}]}, \"synonyms\":{}}");

	add("accrual", "{\"term\":\"accrual\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|accrue|al|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An increase; something that accumulates, especially an amount of money that periodically accumulates for a specific purpos\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"a charge incurred in one accounting period that has not been paid by the end of it\", \"priority\":2}]}, \"synonyms\":{}}");

	add("accubation", "{\"term\":\"accubation\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Latin\"], \"text\":\"Latin \u0027accubatio\u0027 \u0027accubitio\u0027 from {{m|la|accubāre||to recline}}, from \u0027\u0027 (ad-) + {{m|la|cubāre||to lie down}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"File:Image from page 065 of The Century dictionary and cyclopedia (1897) thumb|\u0027\u0027Accubation\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The act or posture of reclining on a couch, as practiced by the ancients at meals\", \"priority\":2}]}, \"synonyms\":{}}");

