	add("accumulation", "{\"term\":\"accumulation\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"* First attested in the late 15th century.* {{suffix|accumulate|tion|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The act of amassing or gathering, as into a pile\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The process of growing into a heap or a large amount\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"an \u0027\u0027accumulation\u0027\u0027 of earth, of sand, of evils, of wealth, or of honors\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A mass of something piled up or collected\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"The concurrence of several titles to the same proof\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"The continuous growth of capital by retention of interest or savings\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"The action of investors buying an asset from other investors when the price of the asset is low\", \"priority\":7}]}, \"synonyms\":{}}");

