	add("accusement", "{\"term\":\"accusement\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"middle french (ca. 1400-1600)\"], \"text\":\"From Middle french (ca. 1400-1600) \u0027acusement\u0027 later uses reformed from {{suffix|accuse|ment|lang\u003den}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An accusation\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"c. 1390\u0027\u0027, \u0027Troilus \u0026amp; Criseyde\u0027, IV.50\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Than þenk I þis were here \u0027\u0027accusement\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1596\u0027\u0027, \u0027The Faerie Queene\u0027, V.9\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"He gan t\u0027efforce the evidence anew, / And new \u0027\u0027accusements\u0027\u0027 to produce in place […\", \"priority\":5}]}, \"synonyms\":{}}");

